import React from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate hook
import "./../../css/landingPage.css";

const Header = () => {
  const navigate = useNavigate(); // Create a navigate function

  const handleClick = () => {
    navigate('/login'); // Navigate to the signup page on button click
  };

  return (
    <header className="header">
      <nav className="navbar">
        <div className="logo">
          <h1>SkillMarket</h1>
        </div>
        <ul className="nav-links">
          <li><a href="#features">Features</a></li>
          <li><a href="#how-it-works">How It Works</a></li>
          <li><a href="#contact">Contact</a></li>
        </ul>
      </nav>
      <div className="hero-section">
        <h2>Connect, Share, and Grow Your Skills</h2>
        <p>Discover new opportunities, showcase your talent, and collaborate with experts!</p>
        <button className="cta-button" onClick={handleClick}>Get Started</button> {/* Handle click */}
      </div>
    </header>
  );
};

export default Header;
